    "2016-09-01T11:50:13.659961",nt"name": "nutrient-content-of-the-u-s-food-supply-1909-2010",nt"isopen":
    true,nt"url": null,nt"notes": "The data presented in this dataset is invaluable
    for monitoring the potential of the food supply to meet nutritional needs; for examining
    relationships between food supply nutrients and health; and for examining dietary
    trends of Americans. Additionally, food supply nutrient estimates reflect Federal
    enrichment and fortification standards and technological advances in the food industry
    and contribute to the Federal dietary guidance system. As such, these data are of
    interest to agricultural policymakers, economists, nutrition researchers, and nutrition
    and public health educators. Data are provided for the following nutrients and their
    food sources from the major food groups.",nt"license_title": "Creative Commons
